import React from "react";
import _ from "lodash";

function Pagination(pageSize, data) {
  const paginationArr = data.length / pageSize;
  const arrPagination = _.range(1, paginationArr);
  return (
    <nav aria-label="...">
      <ul class="pagination pagination-lg">
        <li class="page-item disabled">
          <a class="page-link" href="#" tabindex="-1">
            1
          </a>
        </li>
        <li class="page-item">
          <a class="page-link" href="#">
            2
          </a>
        </li>
        <li class="page-item">
          <a class="page-link" href="#">
            3
          </a>
        </li>
      </ul>
    </nav>
  );
}

export default Pagination;
